import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./styles/main.css";
import Console from "./Components/Console";
import Button from "./Components/Button";

const e = React.createElement;

class App extends React.Component {
  constructor(props) {
    super(props);
    this.clearConsole = this.clearConsole.bind(this);
    this.state = {
      console: ["10:00:00 [Training...]", "alex2"],
      epochs: 30
    };
  }

  componentDidMount() {}

  clearConsole() {
    console.log("cliecked");
    this.setState({
      console:[...this.state.console, "Alex1"]
    });

    console.log(this.state.console)
  }


  render() {
    return e(
      "div",
      { className: "container c-design" },
      e(
        "div",
        { className: "row" },
        e(
          "div",
          { className: "col-md-6 content-console" },
          e("p", null, "Console"),
          <Console
            console={this.state.console}
          />,
          <Button label="Add" onClick={this.clearConsole} />,
          <Button label ="Clear" onClick={this.clearConsole} />
        ),
        e("div", { className: "col-md-6 content-admin" }, e("p", {}, "Train"))
      )
    );
  }
}

export default App;
